import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'lib-util-library',
  imports: [CommonModule],
  templateUrl: './util-library.component.html',
  styleUrl: './util-library.component.css',
})
export class UtilLibraryComponent {}
